import React ,{ Component } from "react"
import Link from "next/link";


class Contact extends Component{
    render()
    {
        return(
            <div>
                <h1>Hello Contact</h1>
                <Link href='/home'>
                    <a>About</a>
                </Link>
            </div>
        );
    }
}

export default Contact;
